//1. Store all characters of string t into a hashmap.
//2. Now for index 0 in String S , check if it's present in main map. If present ,then create a copy of map and iterate over the string from 
//   current index.Now if the current character is found in main map , then remove this character from copy map.
//3. After each removal, check if map is empty and if length of substring is minimum, then update final string and change found to true.
//4. If found is true , then return minimum substring, else return null string.
import java.util.HashMap;

public class minimumWindowSubstring {
    public static String minWindow(String s, String t) {
        if(s.length()<t.length())   return "";
        HashMap<Character,Integer> map = new HashMap<>();
        for(char c:t.toCharArray()){
            if(!map.containsKey(c)) map.put(c,1);
            else map.put(c,map.get(c)+1);
        }
        String min = s;
        boolean found = false;
        for(int i = 0;i<s.length();i++){
            if(map.containsKey(s.charAt(i))){
                HashMap<Character,Integer> copy = new HashMap<>(map);
                for(int j = i;j<s.length();j++){
                    if(map.containsKey(s.charAt(j))){
                        if(copy.size() == 0 && !copy.containsKey(s.charAt(j)))  break;
                        if(copy.containsKey(s.charAt(j))){
                            if(copy.get(s.charAt(j))>1){
                                copy.put(s.charAt(j),copy.get(s.charAt(j))-1);
                                continue;
                            }
                            else copy.remove(s.charAt(j));
                        }
                        if(copy.size() == 0 && j-i+1<=min.length()){
                            min = s.substring(i,j+1);
                            found = true;
                            break;
                        }
                    }
                }
            }
        }
        if(found)   return min;
        return "";
    }


    public static void main(String[] args) {
        String s = "";
        String t = "";
        System.out.println(minWindow(s,t));

    }
}
